import React from "react";
import "./About.css";


const About = () => {
  return (
    <div style={{ padding: "60px" }}>
      <h1>About Us</h1>
      <p>
        Welcome to Shopper! We bring you the latest and most stylish trends from top brands. 
        Our mission is to deliver quality products with exceptional service.
      </p>
    </div>
  );
};

export default About;
